import React from 'react';

class Skills extends React.Component {
  constructor(props) {
    super(props);
    this.state ={

    }

  }

  render() {
    return(
      <div>
        <div id='particles'>
          <Particles
            params={{
              particles: {
                number: {
                  value: 7,
                  density: {
                    enable: true,
                    value_area: 50,
                  }
                },
                color: {
                  value: "#ffffff"
                },
                line_linked: {
                  color: "#ffffff",
                  width: .75
                },
                size: {
                  value: 4
                },
                move: {
                  speed: 1.7
                }
              },
            }}
          />
        </div>
        <Router>
          <Switch>
            <Route path="/skills" component={Skills} />
            <Route path="/resume" component={Resume} />
            <Route path="/intro" component={Intro} />
            <Route exact path="/" component={Home} />
          </Switch>
        </Router>
      </div>
    );
  }
}

export default Skills;
